import React from 'react';
import palette from '../../lib/styles/palette';
import Button from '../common/Button';
import styled from 'styled-components';



const BackTemplate=styled.div`

position:absolute;
left:0;
right:0;
top:0;
bottom:0;

background:${palette.gray[2]};
padding-left:10px;
padding-right:10px;

display:flex;


`;

const listBackTemplate=styled.div`

width:30%;
background:${palette.gray[5]};

`;


const tableBackTemplate=styled.div`

width:70%;
background:${palette.gray[9]};

`;







const Graph=()=>{




    return (
        
    <BackTemplate>
        <listBackTemplate></listBackTemplate>
        <tableBackTemplate></tableBackTemplate>
    </BackTemplate>
    
    );
}



export default Graph;
